import styles from '../dashboard.module.scss';
import Navbar from '../../common/navbar/Navbar';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { url } from '../../utils/constants';

function DroneManagement() {

    const [drones, setDrones] = useState([]);
    const [showEditPopup, setShowEditPopup] = useState(false);
    const [currentDrone, setCurrentDrone] = useState();

    const [model, setModel] = useState('');
    const [service, setService] = useState('');
    const [status, setStatus] = useState('');

    useEffect(() => {
        axios.get(`${url}/api/drone/`, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response);
                setDrones(response.data.data);
            })
            .catch(function (error) {
                console.log(error);
            });
    }, [])

    console.log('drones', drones);

    const deleteDrone = (id) => {
        axios.delete(`${url}/api/drone/delete/${id}`, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response);
                window.location.reload();
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    const editDrone = (id) => {
        setShowEditPopup(true);
        setCurrentDrone(drones.filter(function(drone) {
            return drone._id === id;
        }))
    }

    const editDroneRequest = () => {
        axios.put(`${url}/api/drone/edit/${currentDrone._id}`, {
            "Content-Type": "application/json",
        }, {
            model: model,
            service: service,
            status: status
        })
            .then(function (response) {
                console.log(response);
                window.location.reload();
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    console.log('currentDrone', currentDrone)

    return (
        <>
            <Navbar />
            <div className={styles['container']}>

                {
                    showEditPopup &&
                    <div className={styles['modal']}>
                        <div className={styles['modal-content']}>
                            <form>
                                <input type="text" value={currentDrone[0].model} onChange={(e) => setModel(e.target.value)} placeholder="Drone Model" />
                                <input type="text" value={currentDrone[0].service} onChange={(e) => setService(e.target.value)} placeholder="Service" />
                                <input type="text" value={currentDrone[0].status} onChange={(e) => setStatus(e.target.value)} placeholder="Status" />
                                <button onClick={editDroneRequest}>Submit</button>
                            </form>
                        </div>
                    </div>
                }

                <div className={styles['sidebar']}>
                    <div className={styles['title']}>
                        Dashboard
                    </div>
                    <div className={styles['options']}>
                        <div className={styles['option']}>
                            Drone Catalog
                        </div>
                        <div className={styles['option-select']}>
                            Drone Management
                        </div>
                        <div className={styles['option']}>
                            Drone Booking
                        </div>
                        <div className={styles['option']}>
                            Drone Cloud Tracking
                        </div>
                    </div>
                </div>
                <div className={styles['body']}>
                    <div className={styles['info-container']}>
                        <div className={styles['header']}>
                            Drone Management
                        </div>
                    </div>

                    <div className={styles['table']}>
                        <div className={styles['title']}>
                            All Drones
                        </div>
                        <div className={styles['display']}>
                            <table>
                                <tr>
                                    <th>Drone ID#</th>
                                    <th>Drone Model</th>
                                    <th>Service</th>
                                    <th>Available, Booked, or Deployed Status</th>
                                    <th>Delete</th>
                                    <th>Modify</th>
                                </tr>
                                {
                                    drones.map((drone, index) => {
                                        return (
                                            <tr key={drone._id}>
                                                <td>{drone._id}</td>
                                                <td>{drone.model}</td>
                                                <td>{drone.service}</td>
                                                <td>{drone.status}</td>
                                                <td><button onClick={() => deleteDrone(drone._id)}>Delete</button></td>
                                                <td><button onClick={() => editDrone(drone._id)}>Edit</button></td>
                                            </tr>
                                        )
                                    })
                                }

                            </table>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default DroneManagement;
